import React from "react";
import { Helmet } from "react-helmet";
import { useCookies } from 'react-cookie';
import '../Components/nav.css';
import { Link } from 'react-router-dom';
import'../view_panel/icons/icons.css'

function View() {
  const [cookies, setCookies, removeCookies] = useCookies(); // Add setCookies

  const handleLogout = () => {
    // Iterate over each cookie and remove it
    for (const cookie in cookies) {
      removeCookies(cookie);
    }
    // Update cookies state to an empty object
    setCookies({});
    // Reload the page after deleting cookies
    window.location.replace("/")
  };
  function Numbers() {
    const [data, setData] = useState([]);

    useEffect(() => {
        // Fetch data from the API
        fetch('http://localhost:8000/api/Numbers/')
            .then(response => response.json())
            .then(data => {
                // Extracting the message array from the API response
                const messages = data[0].message;
                setData(messages);
            })
            .catch(error => {
                console.error('Error fetching data:', error);
            });
    }, []);
    return (
        <div>
            <table style={tableStyle}>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Name</th>
                        <th>mail</th>
                        <th>contact</th>
                    </tr>
                </thead>
                <tbody>
                    {data.map((item, index) => (
                        <tr key={index}>
                            <td style={cellStyle}>{item[0]}</td>
                            <td style={cellStyle}>{item[1]}</td>
                            <td style={cellStyle}>{item[2]}</td>
                            <td style={cellStyle}>{item[4]}</td>
                        </tr>
                    ))}
                </tbody>
            </table>

        </div>
    );
}

  return (
    <div id='panel'>
      <div id="Dashborad"></div>
      <New />

      <Link to="/Users"><div id="Users"><div class="all"></div><h2>List of users {}%</h2></div></Link>
      <Link to="/Orders"><div id="orders"><div class="all"></div><h2> Total Orders</h2></div></Link>
      <Link to="/Users"><div id="items"><div class="all"></div><h2>list of Items %</h2></div></Link>
      <Link to="/Profi"><div id="Profi"><h2><div id="icon"></div>Profile</h2></div></Link>

</div>
  );
}
class  New extends React.Component {
  render() {
    return (
      <div className="application">
        <Helmet>
          <meta charSet="utf-8" />
          <title>My ASSASSIN</title>
          <link rel="shortcut icon" href="https://cdn.oaistatic.com/_next/static/media/favicon-32x32.be48395e.png" />
        </Helmet>
      </div>
    );
  }
};

export default View;
